import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'columnToAxisData',
  standalone: true,
})
export class ColumnToAxisDataPipe implements PipeTransform {
  transform(column: string | null | undefined, value: Array<any[]>, columns: string[]): any[] {
    if (!column) return value;
    const idx = columns.indexOf(column);
    if (idx === -1) return [];
    return value.map(item => item[idx]);
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'columnToIndex',
  standalone: true,
})
export class ColumnToIndexPipe implements PipeTransform {
  transform(column: string | null| undefined, columns: string[]): number {
    if (column === undefined) return -1;
    if (column === null) return -1;
    return columns.indexOf(column);
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'ipAnonymization',
  standalone: true
})
export class IpAnonymizationPipe implements PipeTransform {
  transform(value: string | null): string {
    if (!value) return '';
    if (/^(https?:\/\/)?\d+\.\d+\.\d+\.\d+.*$/.test(value)) {
      const chunk = value.split('.')
      return [chunk[0], '***', '***', chunk[3]].join('.');
    }
    return value;
  }
}

import { Pipe, PipeTransform } from '@angular/core';

@Pipe({
  name: 'patternFilter',
  standalone: true,
})
export class PatternFilterPipe implements PipeTransform {
  transform(list: any[], pattern: string | null, keys: string | string[] | null = null): any[] {
    if (!pattern) return list;
    const regex = this.toRegEx(pattern);
    return list.filter(item => {
      let value = item;
      if (!keys) return regex.test(value);
      if (!Array.isArray(keys)) keys = [keys];
      for (const key of keys) value = value[key];
      return regex.test(value ?? '');
    });
  }

  private toRegEx(value: string) {
    const s = '.*+?^$[]{}()|\\';
    value = value.split('').map(c => s.includes(c) ? '\\' + c : c).join('');
    return new RegExp(`${value}`, 'i');
  }
}

