import {
  AfterViewInit,
  Component, computed, effect,
  ElementRef,
  HostBinding,
  HostListener,
  Input,
  input,
  viewChild
} from '@angular/core';
import * as d3 from 'd3';

@Component({
  selector: 'etri-bar-chart',
  standalone: true,
  styleUrls: ['bar-chart.component.scss'],
  templateUrl: 'bar-chart.component.html',
})
export class BarChartComponent implements AfterViewInit {
  readonly x = input<(string | number)[]>([]);
  readonly y = input<number[]>([]);
  readonly xAxisLabel = input<string | null>(null);
  readonly yAxisLabel = input<string | null>(null);
  readonly title = input<string | null>(null);
  readonly chartRef = viewChild<ElementRef<HTMLDivElement>>('chartRef');
  readonly X = computed(() => {
    const x = this.x();
    return x.map((v, i) => {
      const count = x.slice(0, i).filter(val => val === v).length;
      return count > 0 ? `${v}_${count}` : String(v);
    });
  });
  @HostBinding('style.height') @Input() height = '500px';

  constructor() {
    effect(() => {
      const x = this.x();
      const y = this.y();
      const xAxisLabel = this.xAxisLabel();
      const yAxisLabel = this.yAxisLabel();
      console.log(xAxisLabel, ':', x);
      console.log(yAxisLabel, ':', y);
      this.updateChart();
    });
  }

  private readonly MAX = 10;
  private readonly MIN = 0;
  private svg!: d3.Selection<SVGSVGElement, unknown, null, undefined>;
  private tooltip!: d3.Selection<HTMLDivElement, unknown, null, undefined>;

  @HostListener('window:resize') onResize() {
    this.updateChart();
  }

  ngAfterViewInit() {
    this.createChart();
  }

  private createChart() {
    const element = this.chartRef()!.nativeElement;
    this.svg = d3.select(element).append('svg');
    this.tooltip = d3.select(element)
      .append('div')
      .style('position', 'absolute')
      .style('display', 'flex')
      .style('align-items', 'center')
      .style('justify-content', 'center')
      .style('text-align', 'center')
      .style('width', 'fit-content')
      .style('height', 'fit-content')
      .style('padding', '0.5rem')
      .style('border-radius', '0.5rem')
      .style('color', 'white')
      .style('background-color', 'rgba(0, 0, 0, 0.8)')
      .style('box-shadow', '2px 2px 2px rgba(0, 0, 0. 0.5)')
      .style('pointer-events', 'none')
      .style('opacity', 0);
    this.updateChart();
  }

  private updateChart() {
    const element = this.chartRef()!.nativeElement;
    const width = element.offsetWidth;
    const height = element.offsetHeight;
    const margin = { top: 60, right: 20, bottom: 70, left: 90 };

    this.svg
      .attr('width', width)
      .attr('height', height);

    const x = d3.scaleBand()
      .domain(this.X())
      .range([margin.left, width - margin.right])
      .padding(0.1);

    const y = d3.scaleLinear()
      .domain([d3.min(this.y()) ?? this.MIN, d3.max(this.y()) ?? this.MAX])
      .nice()
      .range([height - margin.bottom, margin.top]);

    const xAxis = (g: any) => g
      .attr('transform', `translate(0,${height - margin.bottom})`)
      .call(d3.axisBottom(x).tickSizeOuter(0));

    const yAxis = (g: any) => g
      .attr('transform', `translate(${margin.left},0)`)
      .call(d3.axisLeft(y));

    const xGrid = (g: any) => g
      .attr('transform', `translate(0,${height - margin.bottom})`)
      .call(d3.axisBottom(x)
        .tickSize(-height + margin.top + margin.bottom)
        .tickFormat('' as any)
      )
      .call((g: any) => g.selectAll('.tick line')
        .attr('stroke', 'lightgrey')
        .attr('stroke-opacity', 0.7))
      .call((g: any) => g.select('.domain').remove());

    const yGrid = (g: any) => g
      .attr('transform', `translate(${margin.left},0)`)
      .call(d3.axisLeft(y)
        .tickSize(-width + margin.left + margin.right)
        .tickFormat('' as any)
      )
      .call((g: any) => g.selectAll('.tick line')
        .attr('stroke', 'lightgrey')
        .attr('stroke-opacity', 0.7))
      .call((g: any) => g.select('.domain').remove());

    this.svg.selectAll('*').remove();

    //   .
    this.svg.append('g').call(xGrid);
    this.svg.append('g').call(yGrid);

    //   
    const positiveColor = d3.scaleSequential(d3.interpolateBlues)
      .domain([0, (d3.max(this.y().filter(d => d > 0)) ?? this.MAX) * 0.5]); //    

    const negativeColor = d3.scaleSequential(d3.interpolateReds)
      .domain([0, (d3.min(this.y().filter(d => d < 0)) ?? this.MIN) * 0.5]); //    

    //   .
    this.svg.append('g')
      .selectAll('rect')
      .data(this.y)
      .join('rect')
      .attr('x', (d, i) => x(this.X()[i])!)
      .attr('y', y(0))
      .attr('height', 0)
      .attr('width', x.bandwidth())
      .attr('fill', d => d > 0 ? positiveColor(d) : negativeColor(d))
      .transition()
      .duration(800)
      .attr('y', d => y(Math.max(0, d)))
      .attr('height', d => Math.abs(y(d) - y(0)));

    this.svg.append('g').call(xAxis);

    if (this.xAxisLabel()) {
      this.svg.append('text')
        .attr('class', 'x label')
        .attr('text-anchor', 'middle')
        .attr('x', width / 2)
        .attr('y', height - margin.bottom + 40) // x   
        .text(this.xAxisLabel());
    }

    this.svg.append('g').call(yAxis);

    if (this.yAxisLabel()) {
      this.svg.append('text')
        .attr('class', 'y label')
        .attr('text-anchor', 'middle')
        .attr('transform', 'rotate(-90)')
        .attr('x', -height / 2)
        .attr('y', margin.left - 60) // y   
        .text(this.yAxisLabel());
    }

    if (this.title()) {
      this.svg.append('text')
        .attr('x', width / 2)
        .attr('y', margin.top / 2)
        .attr('text-anchor', 'middle')
        .attr('class', 'chart-title')
        .text(this.title());
    }

    this.svg.selectAll('rect')
      .on('mouseover', (event, d: any) => {
        this.tooltip.transition()
          .duration(200)
          .style('opacity', .9);
        this.tooltip.html(`x: ${this.X()[this.y().indexOf(d)]}<br/>y: ${d}`)
          .style('left', (event.pageX + 5) + 'px')
          .style('top', (event.pageY - 5) + 'px'); //   
      })
      .on('mouseout', () => {
        this.tooltip.transition()
          .duration(500)
          .style('opacity', 0);
      });
  }
}

