import { Dialog } from '@angular/cdk/dialog';
import { DecimalPipe, JsonPipe } from '@angular/common';
import { Component, computed, inject, signal, WritableSignal } from '@angular/core';
import { RouterLink } from '@angular/router';
import {
  ArrowUpTrayIconComponent,
  DocumentMagnifyingGlassIconComponent, ImportModelDialog,
  LoadingComponent,
  ModelDialog,
  PencilSquareIconComponent,
  SearchInputComponent,
  TrashIconComponent,
  UpdateModelDialog
} from '../../../../components';
import { Model } from '../../../../dto';
import { IpAnonymizationPipe, PatternFilterPipe } from '../../../../pipes';
import { ModelService, TraindbService } from '../../../../services';

@Component({
  imports: [
    RouterLink,
    DecimalPipe,
    LoadingComponent,
    JsonPipe,
    PatternFilterPipe,
    SearchInputComponent,
    IpAnonymizationPipe,
    TrashIconComponent,
    PencilSquareIconComponent,
    DocumentMagnifyingGlassIconComponent,
    ArrowUpTrayIconComponent,
  ],
  selector: 'etri-model-list-page',
  standalone: true,
  styleUrls: ['model-list-page.component.scss'],
  templateUrl: 'model-list-page.component.html'
})
export class ModelListPageComponent {
  readonly modelList: WritableSignal<Model[]> = signal([]);
  readonly loading = computed(() => this.modelService.loading());
  readonly keyword = signal('');
  private readonly traindbService = inject(TraindbService);
  private readonly modelService = inject(ModelService);
  private readonly dialog = inject(Dialog);

  constructor() {
    this.loadModels();
  }

  updateModel(model: Model) {
    const dialog = this.dialog.open(UpdateModelDialog, {
      data: model
    });
    dialog.closed.subscribe(res => {
      if (res) this.loadModels();
    });
  }

  deleteModel(model: Model) {
    if (!confirm(`${model.name} ?`)) return;
    const traindbId = this.traindbService.currentId();
    this.modelService.deleteModel(traindbId!, model.name).subscribe({
      next: () => this.loadModels(),
      error: err => {
        console.error(err);
        alert(`Error: ${err.error?.detail ?? err.message}`);
      }
    })
  }

  showDetail(model: Model) {
    this.dialog.open(ModelDialog, { data: model });
  }

  importModel() {
    const dialog = this.dialog.open(ImportModelDialog);
    dialog.closed.subscribe(res => {
      if (res) this.loadModels();
    });
  }

  private loadModels() {
    const traindbId = this.traindbService.currentId();
    this.modelService.searchModels(traindbId!).subscribe({
      next: list => this.modelList.set(list),
      error: console.error,
    });
  }
}

import { Component, inject, OnDestroy, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, FormsModule, ReactiveFormsModule, Validators } from '@angular/forms';
import { Router, RouterLink } from '@angular/router';
import { finalize, Subscription } from 'rxjs';
import { LoadingComponent } from '../../../../components';
import { ModeltypeService, TraindbService } from '../../../../services';

@Component({
  selector: 'etri-modeltype-form-page',
  standalone: true,
  styleUrls: ['modeltype-form-page.component.scss'],
  templateUrl: 'modeltype-form-page.component.html',
  imports: [
    FormsModule,
    LoadingComponent,
    RouterLink,
    ReactiveFormsModule
  ]
})
export class ModeltypeFormPageComponent implements OnInit, OnDestroy {
  loading = false;
  conflictName = false;
  readonly formGroup: FormGroup;
  private readonly traindbService = inject(TraindbService);
  private readonly modeltypeService = inject(ModeltypeService);
  private readonly router = inject(Router);
  private readonly subscription = new Subscription();

  constructor(formBuilder: FormBuilder) {
    this.formGroup = formBuilder.group({
      name: [null, [Validators.required]],
      category: [null, [Validators.required]],
      location: [null, [Validators.required]],
      className: [null, [Validators.required]],
      uri: [null, [Validators.required]]
    });
  }

  submit() {
    const dto = this.formGroup.getRawValue();
    const traindbId = this.traindbService.currentId();
    if (!traindbId) return;
    this.loading = true;
    this.modeltypeService.createModeltype(traindbId, dto).pipe(
      finalize(() => this.loading = false),
    ).subscribe({
      next: () => this.router.navigate(['/modeltypes']),
      error: err => {
        console.error(err);
        if (err.status === 409) {
          this.conflictName = true;
          alert('    .');
          return;
        }
        alert(`Error: ${err.error?.detail ?? err.message}`);
      }
    })
  }

  ngOnInit() {
    this.subscription.add(
      this.formGroup.valueChanges.subscribe(() => this.conflictName = false)
    );
  }

  ngOnDestroy() {
    this.subscription.unsubscribe();
  }
}

